import './App.css';
import Main from './containers/Main';
import AlJalil from './containers/AlJalil';
import AlNoor from './containers/AlNoor';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <Router>
    <Switch>
    <Route path="/aljalil">
      <AlJalil />
    </Route>
    <Route path="/alnoor">
      <AlNoor />
    </Route>
    <Route path="/">
      <Main/> 
    </Route>
  </Switch>

    </Router>
    );
}

export default App;
